class UnitComponent extends Component {
    constructor(props) {
        super(props)
        this.state = {
            show: props.show
        }
    }

    render() {

        return (
            <div className="container ">
                <div className="row">Units </div>
            </div>
        )
    }
}

export default UnitComponent
